import React from 'react';
import logo from './logo.svg';
import { Button,Nav,NavbarBrand,Navbar,Form ,FormControl} from 'react-bootstrap';

import './App.css';

class App extends React.Component {
  render(){
  return (
    <div className="App">

     <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="https://i0.wp.com/blog.logrocket.com/wp-content/uploads/2018/05/react-bootstrap-tutorial.png?fit=544%2C472&ssl=1"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />
      {'EraMint'}
    </Navbar.Brand>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-primary">Search</Button>
    </Form>
    <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link>

  </Navbar>
    </div>
  );
}
}
export default App;
